import birdsActionTypes from "./birds.types";

export const fetchImageSuccess = (imageUrl) => ({
  type: birdsActionTypes.FETCH_IMAGE_SUCCESS,
  payload: imageUrl,
});

export const fetchImageFailure = (error) => ({
  type: birdsActionTypes.FETCH_SONG_FAILURE,
  payload: error,
});
